import React from "react";
function Summary(){
    return (
        <div className='container' style={{marginTop: '40px'}}>
            <div className='row'>
            <div class="input-group mb-3">
                <p>
                    We have 4 Clusters of customers
                </p>
            </div>
            </div>
        </div>
    )
}
export default Summary;
